// Home.js

import React, { useEffect, useState } from 'react';
import './Home.css'; // Import the CSS file

const Home = () => {
    const [current, setCurrent] = useState(0);
    const items = [
        'path/to/your/image1.jpg', // Replace with your image paths
        'path/to/your/image2.jpg',
        'path/to/your/image3.jpg',
    ];

    useEffect(() => {
        const interval = setInterval(() => {
            setCurrent((prev) => (prev + 1) % items.length);
        }, 3000); // Change every 3 seconds
        return () => clearInterval(interval);
    }, [items.length]);

    return (
        <div>
            {/* Navbar */}
            <nav className="navbar">
                <div className="navbar-brand">Art Gallery</div>
                <div className="navbar-links">
                    <a href="/">Home</a>
                    <a href="/artworks">Artworks</a>
                    <a href="/add-artwork">Add Artwork</a>
                    <a href="/login">Login</a>
                    <a href="/register">Register</a>
                </div>
            </nav>

            {/* Carousel */}
            <div className="carousel">
                {items.map((item, index) => (
                    <div
                        className="carousel-item"
                        style={{ opacity: current === index ? 1 : 0 }}
                        key={index}
                    >
                        <img src={item} alt={`Artwork ${index + 1}`} />
                    </div>
                ))}
            </div>
            <h1>Welcome to the Art Gallery</h1>
            <p>Please Login or Register to view the artworks.</p>

            {/* Card Section */}
            <div className="main">
                <div className="card">
                    <div className="fl">
                        <div className="fullscreen">
                            <svg viewBox="0 0 100 100" className="fullscreen_svg">
                                <path d="..."></path> {/* SVG path omitted for brevity */}
                            </svg>
                        </div>
                    </div>
                    <div className="card_content">
                        <label className="switch_738">
                            <input type="checkbox" className="chk_738" />
                            <span className="slider_738"></span>
                        </label>
                    </div>
                    <div className="card_back"></div>
                </div>
                <div className="data">
                    <div className="img">
                        {/* Add your SVG artwork here */}
                    </div>
                    <div className="text">
                        <div className="text_m">CSS Theme Switch</div>
                        <div className="text_s">Praashoo7</div>
                    </div>
                </div>
                <div className="btns">
                    <div className="likes">
                        <svg className="likes_svg" viewBox="0 0 100 100"><path d="..."></path></svg>
                        <span className="likes_text">22</span>
                    </div>
                    <div className="comments">
                        <svg className="comments_svg" viewBox="0 0 100 100"><path d="..."></path></svg>
                        <span className="comments_text">12</span>
                    </div>
                    <div className="views">
                        <svg className="views_svg" viewBox="0 0 100 100"><path d="..."></path></svg>
                        <span className="views_text">332</span>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Home;
